import React from 'react';
import { Container,Box,Text}from '@chakra-ui/react'

const Homepage= () => {
    return <Container maxW="xl" centerContent>    

    <Box
        d={"flex"}
        justifyContent={"center"}
        p={3}
        bg={"white"}
        w="100%"
        m="40 px 0 15 px 0"
        borderRadius={"lg"}
        borderWidth={"1px"}


    
    
    
        >

        <Text>ChatBox</Text>


    </Box>



    </Container>
    
};

export default Homepage
